import './App.css';
import React, { useEffect, useState } from "react";
import * as actions from './store/actions';
import { useSelector, useDispatch } from 'react-redux';
import EditableTable from './components/EditableTable/EditableTable';
import DatabaseList from './components/DatabaseLIst/DatabaseList';
import Server from './Axios/Server';

function App() {
  const dispatch = useDispatch();
  const tableData = useSelector(state => state.tableData);
  const columnsName = useSelector(state => state.columnsName);

  const [tabel_obat, set_table_obat] = useState([{Id_Anggota: 'ANG-003'}]);

  useEffect(() => { 
    Server.fetchTableData('tabel_obat').then(res => set_table_obat(res.data));
  }, [])  

  return (
    <div className="App">
      <h1>Apotek Jakarta</h1>
      <br></br>
      <DatabaseList></DatabaseList>
      <br></br>
      <EditableTable
        tableData={tabel_obat}
      ></EditableTable>
    </div>
  );
}

export default App;
